/* eslint-disable no-console */
import axios from 'axios';

export function getAccountsApi() {
  return axios.get('http://localhost:3001/users/login');
}

export function getLoginTokens(value) {
  console.log('fetching data');
  const data = axios.post('http://localhost:3001/users/logintokens', {
    code: value,
    type: 'people',
  });
  return data;
}

export function getContactsApi() {
  console.log('fetching data');
  const data = axios.post('http://localhost:3001/contacts', {
    uuid: '2196e5d6-8b45-4b28-98c6-2aa34618d7b8',
  });
  return data;
}

export function logoutUser() {
  return axios.post('/api/users/logout');
}
